import React from 'react'
import SeriesItem from "./SeriesItem";
import ListItem from "@material-ui/core/ListItem";

export default class SeriesList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      seriesItemView: [],
    }
  }

  componentDidMount() {
    if (this.props.series !== null) {
      let _seriesItemView = [];
      this.props.series.forEach(s => {
        _seriesItemView.push(<p>{s.seriesNumber}</p>);
      });
      this.setState({seriesItemView: _seriesItemView});
    }
  }

  render() {
    let _seriesItems = [];
    if(this.props.series !== null){
      this.props.series.forEach(s => {
        _seriesItems.push(<p>{s.seriesNumber}</p>);
      });
    }
    return (
      <ListItem>
        {_seriesItems.length > 0 ?
          _seriesItems : (<p style={{padding: 0, margin: '5px 10px 5px 10px'}}>nothing</p>)
        }
      </ListItem>
    );
  }
}
